create table lote
(
    id               bigint auto_increment
        primary key,
    data_cadastro    datetime(6)  not null,
    deletado         bit          not null,
    fabricante       varchar(255) null,
    id_func_cadastro varchar(255) null,
    id_produto       bigint       null,
    lote             varchar(255) null,
    qtd_disponivel   bigint       null,
    qtd_inicial      bigint       null,
    validade         varchar(255) null,
    product_id       bigint       null,
    constraint FK62uya0nbbnfe5s9of743iddfe
        foreign key (product_id) references produto (id)
);

